asyncTest("Select all by ID", 1, function () {
    forge.contact.selectAll(['id'], function(contacts) {
	contacts.forEach(function(ref) {
	    forge.contact.selectById(ref.id, function (contact) {
		try {
		    JSON.stringify(contact);
		} catch (e) {
		    ok(false, "Error invalid contact: " + JSON.stringify(e));
		}
	    });
	});
	ok(true, "Success");
	start();
    }, function (e) {
	ok(false, "Error callback fired: " + e.message);
	start();
    });
});

asyncTest("Add contact", 1, function () {
    console.log("wtf");

    forge.contact.add(
	contactJaneDoe,

	function(id) {	// success
	    // Try to re-fetch.
	    forge.contact.selectById(
		id,
		
		function(contact) {
		    // We can't really test the photo -- the iPhone modifies it, 
		    // and we don't yet support it on Android, so screw it.
		    delete contact.photos;

		    // Make sure the contact's ID is what we asked for...
		    if (contact.id != id) {
		    	ok(false, 'asked for ID ' + id + ' but got ID ' + contact.id);
		    } else {
		    	// So far so good. Smite the id field...
			delete contact.id;

			// ...then make a duplicate of contactJaneDoe with no
			// id or photo.

			delete contactJaneDoe.id;
			delete contactJaneDoe.photos;

			// Also, at the moment the organization element gets a little weird coming back, so make sure
			// that contactJaneDoe doesn't have type or pref.
			//
			// XXX
			// pref, OK, but _type_??
			if (contactJaneDoe.organizations) {
			    delete contactJaneDoe.organizations[0].pref;
			    delete contactJaneDoe.organizations[0].type;
			}

			// Finally, compare our two tweaked objects.
			deepEqual(contact, contactJaneDoe, 'need to get our contact back');
		    }

		    start();
		},

		function(e) {
		    ok(false, "Error callback (2) fired: " + e.message);
		    start();
		}
	    );
	},

	function(e) {	// failure
	    ok(false, "Error callback (1) fired: " + e.message);
	    start();
	}
    );
});
